import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
      	<Grid />
      </div>
    );
  }
}

const size = 5;

class Grid extends Component {
	render() {
		return (
			<div style={{margin:'100px'}}>
				<button>hi</button>
				<button>hi</button>
				<button>hi</button>
				<br/>
				<button>hi</button>
				<button>hi</button>
				<button>hi</button>
				<br/>
				<button>hi</button>
				<button>hi</button>
				<button>hi</button>
			</div>
		);
	}

	createTable = () => {
    let table = []

    // Outer loop to create parent
    for (let i = 0; i < 3; i++) {
      let children = []
      //Inner loop to create children
      for (let j = 0; j < 5; j++) {
        children.push(<td>{`Column ${j + 1}`}</td>)
      }
      //Create the parent and add the children
      table.push(<tr>{children}</tr>)
    }
    return table
  };
}

export default App;
